import React from 'react';
import './styles/Profile.css';
import Profile from './ProfileComponents/Profile';
import Favorites from './ProfileComponents/Favorites';
import { Link, Route, Router, BrowserRouter } from 'react-router-dom';

class ProfilePage extends React.Component{
    render(){
        return(
            <div className="container prof-con border rounded">
                <div className="left-prof-div border-end">
                    <div className="photo-and-name">
                        <img src="https://i.ytimg.com/vi/Ue1eHtvWRTU/maxresdefault.jpg" className="border border-1 border-secondary" id="profilePhotoSmall"></img>
                        <h6>Yilmaz Gokpinar</h6>
                    </div>
                    <div id="profile-category">
                        <span className="bg-primary" className="bg-primary"><i className="far fa-user"></i>Profil</span>
                        <Link to="/prof/fav"><span className=""><i className="fas fa-cog"></i>Innstillinger</span></Link>
                        <Link to="/prof/profile"><span className=""><i className="fas fa-cog"></i>Innstillinger</span></Link>
                        <span className="bg-primary"><i className="fas fa-envelope"></i>Meldinger</span>
                        <span className="bg-primary"><i className="fas fa-heart"></i>Favoritter</span>
                        <span className="bg-primary"><i className="fas fa-bullhorn"></i>Mine Annonser</span>
                        <span className="bg-primary"><i className="fas fa-bookmark"></i>Lagrade Søk</span>
                        <span className="bg-primary"><i className="fas fa-star-half-alt"></i>Vurderinger</span>
                    </div>
                </div>
                <div className="right-prof-div">
                    <BrowserRouter>
                    <Route path="/prof/fav" component={Favorites}></Route>

                        <Route path="/prof/profile" component={Profile}></Route>

                    </BrowserRouter>
                </div>
            </div>
        )
    }
}

export default ProfilePage;
